Within 90 minutes, someone is going to die... And the clock is ticking.

Gene Watson arrives home in Los Angeles, after attending his ex-wife's funeral, with his daughter. Soon, his daughter is kidnapped. He is given a gun, and the picture and itinerary of a person, and told that if he hasn't killed that person in one hour and fifteen minutes, his daughter will be killed. We then follow him through that time.
